.modal-overlay {
  position: fixed;
  top: 0;
  left: 0;
  right: 0;
  bottom: 0;
  background-color: rgba(0, 0, 0, 0.5);
  display: flex;
  align-items: center;
  justify-content: center;
  z-index: 1000;
}

.address-modal {
  background-color: white;
  padding: 30px;
  border-radius: 10px;
  width: 90%;
  max-width: 500px;
  position: relative;
}

.close-button {
  position: absolute;
  top: 15px;
  right: 15px;
  background: none;
  border: none;
  font-size: 1.5rem;
  color: #666;
  cursor: pointer;
}

.address-modal h2 {
  font-family: "Roboto", sans-serif;
  font-size: 1.5rem;
  color: #2c2f11;
  margin-bottom: 20px;
}

.form-group {
  margin-bottom: 20px;
}

.form-group label {
  display: block;
  font-family: "Roboto", sans-serif;
  font-size: 1rem;
  color: #333;
  margin-bottom: 5px;
}

.form-group input {
  width: 100%;
  padding: 10px;
  border: 1px solid #ddd;
  border-radius: 5px;
  font-family: "Roboto", sans-serif;
  font-size: 1rem;
}

.form-group input:focus {
  outline: none;
  border-color: #2c2f11;
}

.save-button {
  width: 100%;
  padding: 15px;
  background-color: #2c2f11;
  color: yellowgreen;
  border: none;
  border-radius: 5px;
  font-family: "Roboto", sans-serif;
  font-size: 1.1rem;
  cursor: pointer;
  transition: opacity 0.3s ease;
}

.save-button:hover {
  opacity: 0.9;
}
